window.bookSummaryJSON = "<p><b>Many things go bump in the night, and I am one of them.</b></p> <p>I made a deal with a god, with death itself, to save someone I love.</p> <p>I thought I had the upper hand, but I was wrong. From the moment he saw me, this god was determined to make me his… but his life is filled with death and is no place for the living. Trying to survive his world might just turn me into one of the lost souls that surround him.</p> <p>But I have my own secrets, my own past.</p> <p>What happens when a god and a mistake meet? What happens when neither will back down?</p> <p>It's all or nothing with us. Before our deal is through, one of us will have lost everything. I will not let that be me.</p> <p><i>Welcome to the Court of Death, where all life comes to an end…</i></p>"; 
